import math

import matplotlib.pyplot as plt
import pandas as pd
import seaborn as sns


def plot_from_pd_series(data_list, title, xlabel, ylabel, bin_scale, output_file):
    pd_series = pd.Series(data_list)

    num_bins = math.ceil((max(data_list) - min(data_list) + 1) / bin_scale)

    pd_series.plot.hist(bins=num_bins, rwidth=0.9, color='royalblue')  # '#607c8e')
    plt.title(title)
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)
    plt.grid(axis='y', alpha=0.25)
    # plt.show()
    plt.savefig(output_file + ".png", bbox_inches='tight')  # , pad_inches = 0.0)
    plt.clf()


